import { FaSpotify, FaGithubSquare } from 'react-icons/fa';

export default () => {

    const handleSpotifyClick = () => {
        window.location.href = 'https://developer.spotify.com/documentation/web-api/';
    }

    return(
        <div id='icon-container'>
          <p style={{fontSize: '90%'}}>Built using the Spotify Web API</p>
          <FaSpotify className='icons' style={{marginBottom: '10%'}} onClick={() => handleSpotifyClick()} />
          <FaGithubSquare className='icons'  />
        </div>
    );
}
